import React, { Component } from "react";
import { Text, View, StyleSheet, Image } from "react-native";
import { Colors, Layout } from "./constants";
import Constants from "expo-constants";
import { RegularText, BoldText, SemiBoldText } from "./components/StyledText";
export default class HomePage extends Component {
  render() {
    return (
      <View style={styles.headerContainer}>
        <Text> textInComponent </Text>
        <View style={styles.headerRowSpeaker}>
          <View style={styles.headerColumnSpeaker}>
            <TouchableOpacity onPress={() => connsole.log("lsjng")}>
              <Image
                source={{
                  uri:
                    "https://static.toiimg.com/photo/msid-71935935/71935935.jpg",
                }}
                style={styles.avatarMultiple}
              />
            </TouchableOpacity>

            <View>
              <TouchableOpacity onPress={() => console.log("sdfn")}>
                <SemiBoldText
                  style={styles.headerText}
                  key={"speakers" + speaker.id + name}
                >
                  "Hetan Thakkar"
                </SemiBoldText>
              </TouchableOpacity>
            </View>
          </View>
        </View>
      </View>
    );
  }
}
const styles = StyleSheet.create({
  headerContainer: {
    backgroundColor: Colors.blue,
    paddingTop: Constants.statusBarHeight + Layout.notchHeight + 160,
    paddingBottom: 20,
    paddingHorizontal: 20,
    alignItems: "center",
    justifyContent: "center",
  },
});
